import React from 'react';
import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip, Legend } from 'recharts';

const data = [
  { name: 'Jan', value: 30 },
  { name: 'Feb', value: 45 },
  { name: 'Mar', value: 60 },
  { name: 'Apr', value: 80 },
  { name: 'May', value: 100 },
  { name: 'Jun', value: 120 }
];

const Summary = () => {
  return (
    <div>
      <h2>Summary of Recent Innovations in Generative AI</h2>
      <LineChart width={600} height={300} data={data}>
        <Line type="monotone" dataKey="value" stroke="#8884d8" />
        <CartesianGrid stroke="#ccc" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
      </LineChart>
      <p>This chart represents the growth in generative AI applications over the past six months.</p>
      <p>Source: <a href="https://example.com">example.com</a></p>
    </div>
  );
};

export default Summary;
